INSERT INTO `tblcontent` (`id`, `page_name`, `description`, `status`, `createddate`) VALUES (1, 'aboutus', '<h3>WHO WE ARE?</h3>\r\n<p><b>KPT Piping System Private limited</b><span></span>is an emerging pipes manufacturing industry which has been functional since 2008. We are keen concern towards trust factor and established as rapidly growing manufacturers, exporters, and suppliers of optimum quality of Pnuemato PP-GF Pipes & fittings, PPR Pipes & Fittings, Fire Retardants, plumbing systems in the plumbing industry. Our products are used in various piping systems; including pressure piping systems, for agriculture use. The company has vision for an astounding growth despites of its inception values.</p>\r\n<p>With our corporate office at New Delhi, KPT Piping System Private Limited has manufacturing facility at Dehradun in Uttarakhand (India) and depots at 10 locations all across India.</p>\r\n<p>We are keen concern towards establishing and maintaining an outstanding position in various industries and with motive to give importance to factors such as quality, distribution network, on-time delivery, storage facility, reasonable prices and ethical practices. We have a team of professionals who keep us abreast with new market strategies and perspective towards all possibilities that can help to expand our business exponentially. All these facets succor to serve the clients in a prompt and efficient manner where total satisfaction of the customer is our motto.</p>', 1, '2021-12-08 15:18:56');
INSERT INTO `tblcontent` (`id`, `page_name`, `description`, `status`, `createddate`) VALUES (3, 'contactus', '<h5>CONTACT DETAILS</h5>\r\n<div class=\"textwidget\">\r\n<div class=\"wpb_wrapper\">\r\n<p><strong>KPT PIPING SYSTEM PRIVATE LIMITED</strong></p>\r\n<p><strong><i class=\"fa fa-map-marker\" aria-hidden=\"true\"></i><span></span>REGD OFFICE</strong>: Unit no. 306 , PP trade Center, Plot No. P-1, Netaji Subhash Place, Delhi-110034 India</p>\r\n<p><strong><i class=\"fa fa-map-marker\" aria-hidden=\"true\"></i><span></span>CORPORATE OFFICE</strong>:<span></span><a href=\"https://goo.gl/maps/xcR3ttyBDDQArMBa7\">122/69, Central Hope Town, Selaqui, Industrial Area, Dehradun, India</a></p>\r\n<p><strong><i class=\"fa fa-mobile\" aria-hidden=\"true\"></i><span></span>Mobile</strong>:<a href=\"tel:8178402742\">+91 8178402742</a>,<span></span><a href=\"tel:9354940961\">+91 9354940961</a></p>\r\n<p><strong><img src=\"https://www.kptpipes.com/wp-content/uploads/2020/08/whatsapp.png\"><span></span>WhatsApp</strong>:<span></span><a href=\"https://wa.me/9354940961\">+91 9354940961</a></p>\r\n<p><strong><i class=\"fa fa-envelope\" aria-hidden=\"true\"></i><span></span>Email</strong>:<span></span><a href=\"mailto:info@kptpipes.com\">info@kptpipes.com</a></p>\r\n</div>\r\n</div>', 1, '2021-12-17 18:16:05');
INSERT INTO `tblcontent` (`id`, `page_name`, `description`, `status`, `createddate`) VALUES (4, 'privacypolicy', '<h1><span xss=removed>Privacy Policy for KPT Pipes</span></h1>\r\n<p>At KPT Pipes, accessible from https://www.kptpipes.com, one of our main priorities is the privacy of our visitors. This Privacy Policy document contains types of information that is collected and recorded by KPT Pipes and how we use it.</p>\r\n<p>If you have additional questions or require more information about our Privacy Policy, do not hesitate to contact us.</p>\r\n<p>This Privacy Policy applies only to our online activities and is valid for visitors to our website with regards to the information that they shared and/or collect in KPT Pipes. This policy is not applicable to any information collected offline or via channels other than this website.<br><strong xss=removed><br>Consent<br></strong><span xss=removed>By using our website, you hereby consent to our Privacy Policy and agree to its terms.</span></p>\r\n<div class=\"vc_row wpb_row section vc_row-fluid \">\r\n<div class=\" full_section_inner clearfix\">\r\n<div class=\"wpb_column vc_column_container vc_col-sm-12\">\r\n<div class=\"vc_column-inner \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_text_column wpb_content_element \">\r\n<div class=\"wpb_wrapper\">\r\n<p><strong>Information we collect<br></strong>The personal information that you are asked to provide, and the reasons why you are asked to provide it, will be made clear to you at the point we ask you to provide your personal information.</p>\r\n<p>If you contact us directly, we may receive additional information about you such as your name, email address, phone number, the contents of the message and/or attachments you may send us, and any other information you may choose to provide.</p>\r\n<p>When you register for an Account, we may ask for your contact information, including items such as name, company name, address, email address, and telephone number.</p>\r\n<h3><strong>How we use your information</strong></h3>\r\n<p>We use the information we collect in various ways, including to:</p>\r\n<ul>\r\n<li>Provide, operate, and maintain our website</li>\r\n<li>Improve, personalize, and expand our website</li>\r\n<li>Understand and analyze how you use our website</li>\r\n<li>Develop new products, services, features, and functionality</li>\r\n<li>Communicate with you, either directly or through one of our partners, including for customer service, to provide you with updates and other information relating to the website, and for marketing and promotional purposes</li>\r\n<li>Send you emails</li>\r\n<li>Find and prevent fraud</li>\r\n</ul>\r\n<h3><strong>Log Files</strong></h3>\r\n<p>KPT Pipes follows a standard procedure of using log files. These files log visitors when they visit websites. All hosting companies do this and a part of hosting services analytics. The information collected by log files include internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, referring/exit pages, and possibly the number of clicks. These are not linked to any information that is personally identifiable. The purpose of the information is for analyzing trends, administering the site, tracking users movement on the website, and gathering demographic information.</p>\r\n<p><strong>Advertising Partners Privacy Policies</strong></p>\r\n<p>You may consult this list to find the Privacy Policy for each of the advertising partners of KPT Pipes.<br>Third-party ad servers or ad networks uses technologies like cookies, JavaScript, or Web Beacons that are used in their respective advertisements and links that appear on KPT Pipes, which are sent directly to users browser. They automatically receive your IP address when this occurs. These technologies are used to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on websites that you visit.<br>Note that KPT Pipes has no access to or control over these cookies that are used by third-party advertisers.</p>\r\n<p><strong>Third Party Privacy Policies</strong></p>\r\n<p>KPT Pipess Privacy Policy does not apply to other advertisers or websites. Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. It may include their practices and instructions about how to opt-out of certain options.<br>You can choose to disable cookies through your individual browser options. To know more detailed information about cookie management with specific web browsers, it can be found at the browsers respective websites.</p>\r\n<p><strong>Childrens Information<br></strong>Another part of our priority is adding protection for children while using the internet. We encourage parents and guardians to observe, participate in, and/or monitor and guide their online activity.<br>KPT Pipes does not knowingly collect any Personal Identifiable Information from children under the age of 13. If you think that your child provided this kind of information on our website, we strongly encourage you to contact us immediately and we will do our best efforts to promptly remove such information from our records.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, '2021-12-17 18:20:38');
INSERT INTO `tblcontent` (`id`, `page_name`, `description`, `status`, `createddate`) VALUES (5, 'terms&condition', '<span>KPT Piping System Private Limited is Indias leading plastic pipes manufacturing company established in the year 2008. We are one of the most trusted and rapidly growing manufacturers, exporters and suppliers of high quality PPR Pipes & Fittings, Pnuemato PP-GF Pipes & Fittings, Fire Retardants and other piping solutions. Our brand KPT is well known as a hallmark of PPR plumbing systems in the plumbing industry. Our products are used in various piping systems; including pressure piping systems.</span>', 1, '2021-12-17 18:22:24');
